import React, { useEffect, useState } from "react";
import {
  FaMoneyBillWave,
  FaChartLine,
  FaCashRegister,
  FaPercentage,
  FaChartPie,
} from "react-icons/fa";
import { getCash } from "../api/CashApi";

const Cash = () => {
  const [cashData, setCashData] = useState({
    initial_cash: 0.0,
    available_cash: 0.0,
    net_pnl: 0.0,
    cash_balance: 0.0,
    roi: 0.0,
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCashData = async () => {
      try {
        const data = await getCash();
        if (data && typeof data === "object" && !Array.isArray(data)) {
          setCashData(data);
        } else {
          console.warn("Expected an object but got:", data);
          setCashData({
            initial_cash: 0.0,
            available_cash: 0.0,
            net_pnl: 0.0,
            cash_balance: 0.0,
            roi: 0.0,
          });
        }
      } catch (error) {
        setError("Error fetching cash data");
        console.error("Error fetching cash data:", error);
        setCashData({
          initial_cash: 0.0,
          available_cash: 0.0,
          net_pnl: 0.0,
          cash_balance: 0.0,
          roi: 0.0,
        });
      } finally {
        setLoading(false);
      }
    };

    fetchCashData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div className="cash-container">
      <div className="cash-card-container">
        <div className="cash-card">
          <div className="card-content">
            <FaCashRegister className="card-icon" />
            <span className="label">Initial Cash:</span>
            <span className="value">${cashData.initial_cash.toFixed(2)}</span>
          </div>
        </div>
        <div className="cash-card">
          <div className="card-content">
            <FaChartPie className="card-icon" />
            <span className="label">Available Cash:</span>
            <span className="value">${cashData.available_cash.toFixed(2)}</span>
          </div>
        </div>
        <div className="cash-card">
          <div className="card-content">
            <FaChartLine className="card-icon" />
            <span className="label">Net P/L:</span>
            <span className="value">${cashData.net_pnl.toFixed(2)}</span>
          </div>
        </div>
        <div className="cash-card">
          <div className="card-content">
            <FaMoneyBillWave className="card-icon" />
            <span className="label">Cash Balance:</span>
            <span className="value">${cashData.cash_balance.toFixed(2)}</span>
          </div>
        </div>
        <div className="cash-card">
          <div className="card-content">
            <FaPercentage className="card-icon" />
            <span className="label">RoI:</span>
            <span className="value">{cashData.roi.toFixed(2)}%</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cash;
